import React from "react";
import { NavLink } from "react-router-dom";
import web from "../src/images/home-header.png";

const Home = () => {
    return (
        <>
            <Common
                name="Welcome to About Page"
                imgsrc={web}
                visit="/contact"
                btname="Contact Now"
            />
        </>
    );
};

export default Home;
